import { useContext } from "react";
import TimelineContext from "../store/TimelineContext";
import Card from "./Card";

export default function Clues() {
  let context = useContext(TimelineContext);
  console.log(context.get);
  let clues = context.get.clues;

  function Stubs() {
    let count = clues.length - 1;
    let stubs = [];
    for (let i=0; i < count; ++i) {
      stubs.push(<div className="cardStub" />);
    }
    return stubs;
  }

  if (clues.length > 0) {
    console.log("Found clues");
    console.log(clues);

  return(
    <div className="clueDeck">
      <Stubs />
      <Card>{clues.at(-1)}</Card>
    </div>
  );
  }
}
